import PasswordInput from "./PasswordInput";
import rightImage from "../../../image/Software_Developer_Kimdir_Ne_Is_Yapar_cdfb584907.webp";
const LoginPage = () => {
  return (
    <>
      <div className={styles.container}>
        <div className={styles.box}>
          <div className={styles.left}>
            <span className={styles.loginName}>Giriş Yap</span>
            <PasswordInput />
            <span className={styles.account}>
              Hesabınız yok mu ? Hemen <a href="">oluşturun</a>
            </span>
          </div>
          <div className={styles.right}>
            <img src={rightImage} alt="" />
          </div>
        </div>
      </div>

      <div className={styles.bgTop}></div>
      <div className={styles.bgBottom}></div>
    </>
  );
};

export default LoginPage;
